import React, { useState } from 'react';
// import './teacher_home.css';

const TeacherHome = () => {
  const [showModal, setShowModal] = useState(false);
  const [projectName, setProjectName] = useState('');
  const [projectDescription, setProjectDescription] = useState('');
  const [projectType, setProjectType] = useState('');
  const [projectDomain, setProjectDomain] = useState('');
  const [prerequisites, setPrerequisites] = useState([]);
  const [newPrerequisite, setNewPrerequisite] = useState('');

  const handleAddPrerequisite = () => {
    if (newPrerequisite.trim() !== '') {
      setPrerequisites([...prerequisites, newPrerequisite]);
      setNewPrerequisite('');
    }
  };

  const handleRemovePrerequisite = (index) => {
    const updatedPrerequisites = [...prerequisites];
    updatedPrerequisites.splice(index, 1);
    setPrerequisites(updatedPrerequisites);
  };

  return (
    <div className="teacher-home-container">
      <h1>Teacher Home</h1>
      <button onClick={() => setShowModal(true)}>ADD PROJECT</button>
      {showModal && (
        <div className="modal">
          <div className="modal-content">
            <span className="close" onClick={() => setShowModal(false)}>&times;</span>
            <form>
              <label>Project Name:</label>
              <input type="text" value={projectName} onChange={(e) => setProjectName(e.target.value)} />
              <label>Project Description:</label>
              <textarea value={projectDescription} onChange={(e) => setProjectDescription(e.target.value)}></textarea>
              <label>Project Type:</label>
              <div>
                <input type="radio" id="lop" name="projectType" value="LOP" onChange={(e) => setProjectType(e.target.value)} />
                <label htmlFor="lop">LOP</label>
                <input type="radio" id="dop" name="projectType" value="DOP" onChange={(e) => setProjectType(e.target.value)} />
                <label htmlFor="dop">DOP</label>
                <input type="radio" id="sop" name="projectType" value="SOP" onChange={(e) => setProjectType(e.target.value)} />
                <label htmlFor="sop">SOP</label>
              </div>
              <label>Project Domain:</label>
              <select value={projectDomain} onChange={(e) => setProjectDomain(e.target.value)}>
                <option value="CS">CS</option>
                <option value="ECE">ECE</option>
                <option value="ENI">ENI</option>
                <option value="EEE">EEE</option>
              </select>
              <label>Pre-requisites:</label>
              <div className="prerequisites">
                <input type="text" value={newPrerequisite} onChange={(e) => setNewPrerequisite(e.target.value)} />
                <button type="button" onClick={handleAddPrerequisite}>Add New</button>
              </div>
              <ul>
                {prerequisites.map((prerequisite, index) => (
                  <li key={index}>
                    {prerequisite}
                    <button type="button" onClick={() => handleRemovePrerequisite(index)}>&times;</button>
                  </li>
                ))}
              </ul>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default TeacherHome;
